//    return (TSet)r;
//}

// 集合减法，val...中存储为位的索引，下标为0
TSet Exclude(TSet s, uint8_t val) {
    return (TSet)(s & (~(1 << val)));
}
//TSet Exclude(TSet s, ...) {
